import "./App.css";

function App() {
  return (
    <div className="loco">
      <h1>Hello</h1>
      <ul>
        <li>My name is Ruslan</li>
        <li>I love programming</li>
        <li>Make me happy</li>
        <li>Enjoy yoursself</li>
      </ul>
    </div>
  );
}

export default App;
